import Header from '../components/Header.js'
import ShopBody from "../components/ShopBody";
import bg from '../assets/S3.jpg'

export default class ProductDetail extends Component {
    render() {
        return (
            <div className="Men">
                <Header/>
                <ShopBody/>
                <Newsletter/>
                <Footer/>
            </div>
        );
    }
}
